import React from "react";
import {TouchableOpacity, Text, StyleSheet} from 'react-native';


export default function Button({onPress, children}) {

    return (
        <TouchableOpacity
            style={styles.button}
            onPress={onPress}>
            <Text
                style={styles.buttonText}>
                {children}
            </Text>
        </TouchableOpacity>
    )
}

const styles = StyleSheet.create({
    button: {
        backgroundColor: '#335563',
        color: '#fff',
        padding: 10,
        borderRadius: 25,
        maxWidth: 500,
        width: '50%',
        marginTop: 25
    },
    buttonText: {
        color: '#fff',
        textAlign: 'center',
        fontSize: 18
    },
})
